import React, { Component } from "react";

export default class Portfolio extends Component {
  render() {
    return (
        <div className="portfolio-container">
          <div className="bio-header">
            <h2>Portfolio</h2>
          </div>
          <div className="boxed2">
          <div className="bio-item">
            <h3>Record Shop</h3>
            <p>An online e-comerce store created using react and redux</p>
            <a href="https://github.com/grace-shopper-MPEB/motherboard">
            <p>learn more</p>
            </a>
            <h3>Capstone</h3>
        </div>
        </div>
      </div>
    );
  }
}
